import React from "react";
import App from "../App";

class NumberList extends React.Component {
    constructor() {
        super();
        this.state = {
            list: [1, 2, 3]
        }
    }
    render() {
        return (
            <div className="numbers">
                {this.state.list.join(" ")}
            </div>
        );
    }
}

export default NumberList;
